import React from "react";
import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div>
      <ul>
        <li>currently reading</li>
        <li>read later</li>
        <li>Book shelf readed</li>
      </ul>
    </div>
  );
};

export default Sidebar;
